actionConfiguration.body:
() => {
		var ret = []
		if (GetJobResponseSubLots.data.data != null){
			for (let i = 0; i < GetJobResponseSubLots.data.data.getStockOnHand.length; i ++) {


				var sealNumber = ""
				var ICCID = ""
				for (let j = 0; j < GetJobResponseSubLots.data.data.getStockOnHand[i].materialSubLot.properties.length; j ++) {
					if (GetJobResponseSubLots.data.data.getStockOnHand[i].materialSubLot.properties[j].name == "SealNumber") {
						sealNumber = GetJobResponseSubLots.data.data.getStockOnHand[i].materialSubLot.properties[j].description
					}
					if (GetJobResponseSubLots.data.data.getStockOnHand[i].materialSubLot.properties[j].name == "ICCIDNumber") {
						ICCID = GetJobResponseSubLots.data.data.getStockOnHand[i].materialSubLot.properties[j].description
					}
				}
				let line = {
					"Serial": GetJobResponseSubLots.data.data.getStockOnHand[i].materialSubLot.code,
					"Seal": sealNumber,
					"ICCID": ICCID,
					"Status": GetJobResponseSubLots.data.data.getStockOnHand[i].status.code,
					"Pallet": GetJobResponseSubLots.data.data.getStockOnHand[i].carrier.code
				}
				return line
				ret.push(line)
			}
			return ret
		}
	}

